import React, {Component} from 'react';
import axios from 'axios';
import Nav from 'react-bootstrap/Nav'
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'

class Profile extends Component {

  async componentDidMount() {
    let userData = {"name": localStorage.getItem('userName')}
    console.log(userData);
    axios.post('http://localhost:5000/profile', userData)
    .then((response) => {
      console.log(response);
    }, (error) => {
      console.log('Looks like there was a problem: \n', error);
    });
  }

  render() {
    return (
      <div className="container">
        <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example">
          <Tab eventKey="profile" title="Profile">
            <div className="row">
              <div className="jumbotron col-12">
                <h1 className="display-3">Welcome, {localStorage.getItem('userName')}!</h1>
                <h2 className="display-3">Current points: {localStorage.getItem('userPoints')}</h2>
              </div>
            </div>
          </Tab>
          <Tab eventKey="posts" title="Posts">
            more text
          </Tab>
          <Tab eventKey="followers" title="Followers">
            hello again
          </Tab>
          <Tab eventKey="following" title="Following">
            hello again2
          </Tab>
        </Tabs>
      </div>
    );
  }
}

export default Profile;
